import { defineMessages } from 'react-intl';

export const scope = 'app.components.ManufacturingDetailsForm';

export default defineMessages({
  manufacturingDetails: {
    id: `${scope}.manufacturingDetails`,
    defaultMessage: 'Manufacturing Details',
  },
  brand: {
    id: `${scope}.brand`,
    defaultMessage: 'Brand Name',
  },
  brandRequired: {
    id: `${scope}.branchNameRequired`,
    defaultMessage: 'Brand field is required.',
  },
  manufacturer: {
    id: `${scope}.manufacturer`,
    defaultMessage: 'Manufacturer',
  },
  manufacturerRequired: {
    id: `${scope}.manufacturerRequired`,
    defaultMessage: 'Manufacturer field is required.',
  },
  partType: {
    id: `${scope}.partType`,
    defaultMessage: 'Part Type',
  },
  partTypeRequired: {
    id: `${scope}.inChargeCodeRequired`,
    defaultMessage: 'Part-Type field is required.',
  },
  typeCode: {
    id: `${scope}.typeCode`,
    defaultMessage: 'Type code',
  },

  saveButtonLabel: {
    id: `${scope}.saveButtonLabel`,
    defaultMessage: 'Save & Next',
  },
  cancelButtonLabe: {
    id: `${scope}.cancelButtonLabe`,
    defaultMessage: 'Clear',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong`,
    defaultMessage: 'Something went wrong while saving Manufacturing Details.',
  },
  manufacturingDetailsSaveSuccess: {
    id: `${scope}.manufacturingDetailsSaveSuccess`,
    defaultMessage: 'Manufacturing Details was saved successfully.',
  },
  selectPartType: {
    id: `${scope}.selectPartType`,
    defaultMessage: 'Select Part Type',
  },
  partUpdateSuccess: {
    id: `${scope}.partUpdateSuccess`,
    defaultMessage: 'Part updated successfully',
  },

});
